import React from 'react';
import './style.css';


class Cards extends React.Component {
  render() {
    return (
      <div className="Cards">
        <img></img>
        <div class="InfoCard">
          <span class="Title">{this.props.title}</span>
          <span class="Description">{this.props.description}</span>
        </div>
       
      </div>
    );
  }
}

export default Cards;
